function sleep(ms){return new Promise(resolve=>setTimeout(resolve,ms))}function clamp(value,min,max){return Math.min(Math.max(value,min),max)}function downloadFile(filename){var e=document.createElement("a");e.href=filename,e.download=filename.slice(filename.lastIndexOf("/")+1),document.body.appendChild(e),e.click(),e.remove()}async function asyncFetch(url){return new Promise((resolve,reject)=>{var n=new Worker("/scripts/src/asyncFetcher.js");n.postMessage([url]),n.onmessage=e=>{resolve(e.data[0])},n.onerror=reject})}export{sleep,clamp,downloadFile,asyncFetch};